character. To move below this area by pressing Tab, press the Esc key followed by the Tab key. In some cases the Esc key will need to be pressed twice before the Tab key will allow you to continue.";s:15:"gettext_context";s:0:"";}i:75;O:8:"stdClass":6:{s:2:"id";s:5:"16754";s:6:"status";N;s:3:"ctx";s:32:"2a16e49e9766bfc86c635bb954eaeec9";s:10:"translated";N;s:8:"original";s:46:"After typing in your edits, click Update File.";s:15:"gettext_context";s:0:"";}i:76;O:8:"stdClass":6:{s:2:"id";s:5:"16755";s:6:"status";N;s:3:"ctx";s:32:"ad4647305c60cfd93de5e674fc745759";s:10:"translated";N;s:8:"original";s:122:"<strong>Advice:</strong> think very carefully about your site crashing if you are live-editing the theme currently in use.";s:15:"gettext_context";s:0:"";}i:77;O:8:"stdClass":6:{s:2:"id";s:5:"16756";s:6:"status";N;s:3:"ctx";s:32:"f8fad59f255386dd0d574e0a93721d0b";s:10:"translated";N;s:8:"original";s:152:"Upgrading to a newer version of the same theme will override changes made here. To avoid this, consider creating a <a href="%s">child theme</a> instead.";s:15:"gettext_context";s:0:"";}i:78;O:8:"stdClass":6:{s:2:"id";s:5:"16757";s:6:"status";N;s:3:"ctx";s:32:"077d5cbb1f4c88abc10c0069ff9d9be3";s:10:"translated";N;s:8:"original";s:94:"<a href="https://codex.wordpress.org/Theme_Development">Documentation on Theme Development</a>";s:15:"gettext_context";s:0:"";}i:79;O:8:"stdClass":6:{s:2:"id";s:5:"16758";s:6:"status";N;s:3:"ctx";s:32:"9dbee5cf8ef48939b391f443c0c56017";s:10:"translated";N;s:8:"original";s:84:"<a href="https://codex.wordpress.org/Using_Themes">Documentation on Using Themes</a>";s:15:"gettext_context";s:0:"";}i:80;O:8:"stdClass":6:{s:2:"id";s:5:"16759";s:6:"status";N;s:3:"ctx";s:32:"c41e513c06c22d8bc7009091b2f00b3e";s:10:"translated";N;s:8:"original";s:86:"<a href="https://codex.wordpress.org/Editing_Files">Documentation on Editing Files</a>";s:15:"gettext_context";s:0:"";}i:81;O:8:"stdClass":6:{s:2:"id";s:5:"16760";s:6:"status";N;s:3:"ctx";s:32:"ee3699f0825104500e0da9f85fa1e13e";s:10:"translated";N;s:8:"original";s:86:"<a href="https://codex.wordpress.org/Template_Tags">Documentation on Template Tags</a>";s:15:"gettext_context";s:0:"";}i:82;O:8:"stdClass":6:{s:2:"id";s:5:"16761";s:6:"status";N;s:3:"ctx";s:32:"001192e1d60764fbbf5d5cebeea7d50d";s:10:"translated";N;s:8:"original";s:21:"Select theme to edit:";s:15:"gettext_context";s:0:"";}i:83;O:8:"stdClass":6:{s:2:"id";s:5:"16762";s:6:"status";N;s:3:"ctx";s:32:"ab17dc20c7e9e24faa2f68f676f6822e";s:10:"translated";N;s:8:"original";s:9:"Templates";s:15:"gettext_context";s:0:"";}i:84;O:8:"stdClass":6:{s:2:"id";s:5:"16763";s:6:"status";N;s:3:"ctx";s:32:"661d901084dde093f6ef4628384de14c";s:10:"translated";N;s:8:"original";s:16:"%s Page Template";s:15:"gettext_context";s:0:"";}i:85;O:8:"stdClass":6:{s:2:"id";s:5:"16764";s:6:"status";N;s:3:"ctx";s:32:"5196b044744f6a673c47c1bd9a592a17";s:10:"translated";N;s:8:"original";s:6:"Styles";s:15:"gettext_context";s:33:"Theme stylesheets in theme editor";}i:86;O:8:"stdClass":6:{s:2:"id";s:5:"16765";s:6:"status";N;s:3:"ctx";s:32:"3e76ce0827f5ae625ad925ad2b4921e7";s:10:"translated";N;s:8:"original";s:11:"Update File";s:15:"gettext_context";s:0:"";}i:87;O:8:"stdClass":6:{s:2:"id";s:5:"16767";s:6:"status";N;s:3:"ctx";s:32:"fb3908a5c57a115d79246a5d2ca342b8";s:10:"translated";N;s:8:"original";s:13:"Manage Themes";s:15:"gettext_context";s:0:"";}i:88;O:8:"stdClass":6:{s:2:"id";s:5:"16768";s:6:"status";N;s:3:"ctx";s:32:"d1501beb0d1dc58db35529b27e34b75a";s:10:"translated";N;s:8:"original";s:182:"This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.";s:15:"gettext_context";s:0:"";}i:89;O:8:"stdClass":6:{s:2:"id";s:5:"16769";s:6:"status";N;s:3:"ctx";s:32:"1e888a7feab476eef0032f48e613b85e";s:10:"translated";N;s:8:"original";s:53:"Hover or tap to see Activate and Live Preview buttons";s:15:"gettext_context";s:0:"";}i:90;O:8:"stdClass":6:{s:2:"id";s:5:"16770";s:6:"status";N;s:3:"ctx";s:32:"1c25c2eaf6ebd764e57c023b7a210f5a";s:10:"translated";N;s:8:"original";s:97:"Click on the theme to see the theme name, version, author, description, tags, and the Delete link";s:15:"gettext_context";s:0:"";}i:91;O:8:"stdClass":6:{s:2:"id";s:5:"16771";s:6:"status";N;s:3:"ctx";s:32:"3ef04431778c77cdade70f366812a210";s:10:"translated";N;s:8:"original";s:95:"Click Customize for the current theme or Live Preview for any other theme to see a live preview";s:15:"gettext_context";s:0:"";}i:92;O:8:"stdClass":6:{s:2:"id";s:5:"16772";s:6:"status";N;s:3:"ctx";s:32:"2c4414afb28b421c247aa0e4057bfd90";s:10:"translated";N;s:8:"original";s:62:"The current theme is displayed highlighted as the first theme.";s:15:"gettext_context";s:0:"";}i:93;O:8:"stdClass":6:{s:2:"id";s:5:"16773";s:6:"status";N;s:3:"ctx";s:32:"1bc81ddaa9962129f39339b7ea4c77e4";s:10:"translated";N;s:8:"original";s:97:"The search for installed themes will search for terms in their name, description, author, or tag.";s:15:"gettext_context";s:0:"";}i:94;O:8:"stdClass":6:{s:2:"id";s:5:"16774";s:6:"status";N;s:3:"ctx";s:32:"85b7f40dae14e2dedd2d051b8da068b4";s:10:"translated";N;s:8:"original";s:375:"If you would like to see more themes to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional themes from the <a href="%s">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!";s:15:"gettext_context";s:0:"";}i:95;O:8:"stdClass":6:{s:2:"id";s:5:"16775";s:6:"status";N;s:3:"ctx";s:32:"c76be323d31fb119d9c1e4e87622b437";s:10:"translated";N;s:8:"original";s:29:"https://wordpress.org/themes/";s:15:"gettext_context";s:0:"";}i:96;O:8:"stdClass":6:{s:2:"id";s:5:"16776";s:6:"status";N;s:3:"ctx";s:32:"dae905075e3e10f0cb4402eebcb9267e";s:10:"translated";N;s:8:"original";s:13:"Adding Themes";s:15:"gettext_context";s:0:"";}i:97;O:8:"stdClass":6:{s:2:"id";s:5:"16777";s:6:"status";N;s:3:"ctx";s:32:"6f6504bc3b2a415851941dc76f520261";s:10:"translated";N;s:8:"original";s:302:"Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.";s:15:"gettext_context";s:0:"";}i:98;O:8:"stdClass":6:{s:2:"id";s:5:"16778";s:6:"status";N;s:3:"ctx";s:32:"fb6282bae5e72544440a25f34d8a4a75";s:10:"translated";N;s:8:"original";s:367:"The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Save &amp; Activate button above the menu.";s:15:"gettext_context";s:0:"";}i:99;O:8:"stdClass":6:{s:2:"id";s:5:"16779";s:6:"status";N;s:3:"ctx";s:32:"ec0c3d224b684a115d955d14d78a3c2b";s:10:"translated";N;s:8:"original";s:246:"When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.";s:15:"gettext_context";s:0:"";}i:100;O:8:"stdClass":6:{s:2:"id";s:5:"16780";s:6:"status";N;s:3:"ctx";s:32:"5f2625cca7abdd0876d0bb689a764079";s:10:"translated";N;s:8:"original";s:26:"Previewing and Customizing";s:15:"gettext_context";s:0:"";}i:101;O:8:"stdClass":6:{s:2:"id";s:5:"16781";s:6:"status";N;s:3:"ctx";s:32:"e2c1ffff5694bf7ae3d63940c7403110";s:10:"translated";N;s:8:"original";s:99:"Are you sure you want to delete this theme?

Click 'Cancel' to go back, 'OK' to confirm the delete.";s:15:"gettext_context";s:0:"";}i:102;O:8:"stdClass":6:{s:2:"id";s:5:"16782";s:6:"status";N;s:3:"ctx";s:32:"2b83713c362be2e2e9edfd29a79aa999";s:10:"translated";N;s:8:"original";s:13:"Add New Theme";s:15:"gettext_context";s:0:"";}i:103;O:8:"stdClass":6:{s:2:"id";s:5:"16783";s:6:"status";N;s:3:"ctx";s:32:"e4cb31fd52643ea3bd43854d47a2410f";s:10:"translated";N;s:8:"original";s:23:"Search Installed Themes";s:15:"gettext_context";s:0:"";}i:104;O:8:"stdClass":6:{s:2:"id";s:5:"16784";s:6:"status";N;s:3:"ctx";s:32:"3a3216fcec193429321d076a94abd6de";s:10:"translated";N;s:8:"original";s:26:"Search installed themes...";s:15:"gettext_context";s:0:"";}i:105;O:8:"stdClass":6:{s:2:"id";s:5:"16785";s:6:"status";N;s:3:"ctx";s:32:"ee4d2d504af9b42b3e5a7464e1d0723d";s:10:"translated";N;s:8:"original";s:26:"Number of Themes found: %d";s:15:"gettext_context";s:0:"";}i:106;O:8:"stdClass":6:{s:2:"id";s:5:"16786";s:6:"status";N;s:3:"ctx";s:32:"68259c8097d118122f6ca9110eb53954";s:10:"translated";N;s:8:"original";s:40:"No themes found. Try a different search.";s:15:"gettext_context";s:0:"";}i:107;O:8:"stdClass":6:{s:2:"id";s:5:"16787";s:6:"status";N;s:3:"ctx";s:32:"b2258393b4f9510e678996ff083853c3";s:10:"translated";N;s:8:"original";s:7:"Add New";s:15:"gettext_context";s:13:"Add new theme";}i:108;O:8:"stdClass":6:{s:2:"id";s:5:"16788";s:6:"status";N;s:3:"ctx";s:32:"a4687dcfe0eba4d80838d6f0481f95d7";s:10:"translated";N;s:8:"original";s:84:"New version available. <button class="button-link" type="button">Update now</button>";s:15:"gettext_context";s:0:"";}i:109;O:8:"stdClass":6:{s:2:"id";s:5:"16789";s:6:"status";N;s:3:"ctx";s:32:"8f3f266e4e5e8a95bf0abf81ff096ebe";s:10:"translated";N;s:8:"original";s:22:"New version available.";s:15:"gettext_context";s:0:"";}i:110;O:8:"stdClass":6:{s:2:"id";s:5:"16790";s:6:"status";N;s:3:"ctx";s:32:"22b0b88f56b9c93b1d1a20dac922d181";s:10:"translated";N;s:8:"original";s:16:"Update Available";s:15:"gettext_context";s:0:"";}i:111;O:8:"stdClass":6:{s:2:"id";s:5:"16792";s:6:"status";N;s:3:"ctx";s:32:"48afc83cf545ef8a2395067746716603";s:10:"translated";N;s:8:"original";s:88:"<a href="https://codex.wordpress.org/Appearance_Menus_Screen">Documentation on Menus</a>";s:15:"gettext_context";s:0:"";}i:112;O:8:"stdClass":6:{s:2:"id";s:5:"16793";s:6:"status";N;s:3:"ctx";s:32:"560d796116b11ddb7808064bbf366bc6";s:10:"translated";N;s:8:"original";s:4:"Page";s:15:"gettext_context";s:0:"";}i:113;O:8:"stdClass":6:{s:2:"id";s:5:"16794";s:6:"status";N;s:3:"ctx";s:32:"4ac1a994353d3ede6bc2c3691d1d43c7";s:10:"translated";N;s:8:"original";s:16:"Display location";s:15:"gettext_context";s:0:"";}i:114;O:8:"stdClass":6:{s:2:"id";s:5:"16825";s:6:"status";N;s:3:"ctx";s:32:"2628ac04367ef5339322e23a38240fb5";s:10:"translated";N;s:8:"original";s:385:"Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.";s:15:"gettext_context";s:0:"";}i:115;O:8:"stdClass":6:{s:2:"id";s:5:"16826";s:6:"status";N;s:3:"ctx";s:32:"c870042c568c84af431c05479fe39260";s:10:"translated";N;s:8:"original";s:324:"The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.";s:15:"gettext_context";s:0:"";}i:116;O:8:"stdClass":6:{s:2:"id";s:5:"16827";s:6:"status";N;s:3:"ctx";s:32:"449caefc4319d4e355a74cfbc0831768";s:10:"translated";N;s:8:"original";s:20:"Removing and Reusing";s:15:"gettext_context";s:0:"";}i:117;O:8:"stdClass":6:{s:2:"id";s:5:"16828";s:6:"status";N;s:3:"ctx";s:32:"f5f6f5978f1a37ee120927289f3f6f8d";s:10:"translated";N;s:8:"original";s:257:"If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.";s:15:"gettext_context";s:0:"";}i:118;O:8:"stdClass":6:{s:2:"id";s:5:"16829";s:6:"status";N;s:3:"ctx";s:32:"cb26d608dcaf5e53bfdccbb076ee7f6b";s:10:"translated";N;s:8:"original";s:123:"Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.";s:15:"gettext_context";s:0:"";}i:119;O:8:"stdClass":6:{s:2:"id";s:5:"16830";s:6:"status";N;s:3:"ctx";s:32:"ac9278c82439b66854fc13fb321c96e5";s:10:"translated";N;s:8:"original";s:119:"Enabling Accessibility Mode, via Screen Options, allows you to use Add and Edit buttons instead of using drag and drop.";s:15:"gettext_context";s:0:"";}i:120;O:8:"stdClass":6:{s:2:"id";s:5:"16831";s:6:"status";N;s:3:"ctx";s:32:"fed26992edec9b0b4e080ce678b8e973";s:10:"translated";N;s:8:"original";s:15:"Missing Widgets";s:15:"gettext_context";s:0:"";}i:121;O:8:"stdClass":6:{s:2:"id";s:5:"16832";s:6:"status";N;s:3:"ctx";s:32:"90a9c622ce04410d1eb4367e50230adf";s:10:"translated";N;s:8:"original";s:276:"Many themes show some sidebar widgets by default until you edit your sidebars, but they are not automatically displayed in your sidebar management tool. After you make your first widget change, you can re-add the default widgets by adding them from the Available Widgets area.";s:15:"gettext_context";s:0:"";}i:122;O:8:"stdClass":6:{s:2:"id";s:5:"16833";s:6:"status";N;s:3:"ctx";s:32:"a4018b4b9fa0ad74ac664770d4fa25bd";s:10:"translated";N;s:8:"original";s:347:"When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.";s:15:"gettext_context";s:0:"";}i:123;O:8:"stdClass":6:{s:2:"id";s:5:"16834";s:6:"status";N;s:3:"ctx";s:32:"5f4aa7fdf5af3ac633eda848724fd1bb";s:10:"translated";N;s:8:"original";s:92:"<a href="https://codex.wordpress.org/Appearance_Widgets_Screen">Documentation on Widgets</a>";s:15:"gettext_context";s:0:"";}i:124;O:8:"stdClass":6:{s:2:"id";s:5:"16835";s:6:"status";N;s:3:"ctx";s:32:"c522f6f2f38c5fe50947cad10691b443";s:10:"translated";N;s:8:"original";s:16:"Inactive Widgets";s:15:"gettext_context";s:0:"";}i:125;O:8:"stdClass":6:{s:2:"id";s:5:"16836";s:6:"status";N;s:3:"ctx";s:32:"4558853d2749bc0312b6511c110ab8c1";s:10:"translated";N;s:8:"original";s:74:"Drag widgets here to remove them from the sidebar but keep their settings.";s:15:"gettext_context";s:0:"";}i:126;O:8:"stdClass":6:{s:2:"id";s:5:"16837";s:6:"status";N;s:3:"ctx";s:32:"4645959f81fac9d9cf031b869f001fde";s:10:"translated";N;s:8:"original";s:19:"Error while saving.";s:15:"gettext_context";s:0:"";}i:127;O:8:"stdClass":6:{s:2:"id";s:5:"16838";s:6:"status";N;s:3:"ctx";s:32:"118f946b06e9f84f5fd846d14c561c1c";s:10:"translated";N;s:8:"original";s:45:"Error in displaying the widget settings form.";s:15:"gettext_context";s:0:"";}i:128;O:8:"stdClass":6:{s:2:"id";s:5:"16839";s:6:"status";N;s:3:"ctx";s:32:"f86df510bdeed3e93a98abdb5f49aab4";s:10:"translated";N;s:8:"original";s:25:"Enable accessibility mode";s:15:"gettext_context";s:0:"";}i:129;O:8:"stdClass":6:{s:2:"id";s:5:"16840";s:6:"status";N;s:3:"ctx";s:32:"c25a2f0bfc28f4fd2627c91729baf0e1";s:10:"translated";N;s:8:"original";s:26:"Disable accessibility mode";s:15:"gettext_context";s:0:"";}i:130;O:8:"stdClass":6:{s:2:"id";s:5:"16841";s:6:"status";N;s:3:"ctx";s:32:"844f18cd54c0205698cf1bcb3e33203d";s:10:"translated";N;s:8:"original";s:17:"Available Widgets";s:15:"gettext_context";s:0:"";}i:131;O:8:"stdClass":6:{s:2:"id";s:5:"16842";s:6:"status";N;s:3:"ctx";s:32:"1daf5c5ca152c0871594ff40b6faf23b";s:10:"translated";N;s:8:"original";s:10:"Deactivate";s:15:"gettext_context";s:15:"removing-widget";}i:132;O:8:"stdClass":6:{s:2:"id";s:5:"16843";s:6:"status";N;s:3:"ctx";s:32:"d4b9b2c2099fc269b01769667cac28f0";s:10:"translated";N;s:8:"original";s:119:"To activate a widget drag it to a sidebar or click on it. To deactivate a widget and delete its settings, drag it back.";s:15:"gettext_context";s:0:"";}i:133;O:8:"stdClass":6:{s:2:"id";s:5:"16844";s:6:"status";N;s:3:"ctx";s:32:"aff4f7138fab5a8dc27861846f213c29";s:10:"translated";N;s:8:"original";s:22:"Clear Inactive Widgets";s:15:"gettext_context";s:0:"";}i:134;O:8:"stdClass":6:{s:2:"id";s:5:"16845";s:6:"status";N;s:3:"ctx";s:32:"5e6e58ace94509a05c7dc8415f76c471";s:10:"translated";N;s:8:"original";s:109:"This will clear all items from the inactive widgets list. You will not be able to restore any customizations.";s:15:"gettext_context";s:0:"";}i:135;O:8:"stdClass":6:{s:2:"id";s:5:"16846";s:6:"status";N;s:3:"ctx";s:32:"44c19ae07403227209083276f029a780";s:10:"translated";N;s:8:"original";s:10:"Add Widget";s:15:"gettext_context";s:0:"";}i:136;O:8:"stdClass":6:{s:2:"id";s:5:"16852";s:6:"status";N;s:3:"ctx";s:32:"584da709487f93539bacc902f147d250";s:10:"translated";N;s:8:"original";s:9:"Configure";s:15:"gettext_context";s:0:"";}i:137;O:8:"stdClass":6:{s:2:"id";s:5:"16902";s:6:"status";N;s:3:"ctx";s:32:"9effa85fcbe64c02a3e6b3b6c39db03b";s:10:"translated";N;s:8:"original";s:21:"Function Name&hellip;";s:15:"gettext_context";s:0:"";}i:138;O:8:"stdClass":6:{s:2:"id";s:5:"16903";s:6:"status";N;s:3:"ctx";s:32:"fcd9481c665fa335d7240da76a4d32c9";s:10:"translated";N;s:8:"original";s:14:"Documentation:";s:15:"gettext_context";s:0:"";}i:139;O:8:"stdClass":6:{s:2:"id";s:5:"16904";s:6:"status";N;s:3:"ctx";s:32:"bf83a27eacaae22d6ef01fc1c7849142";s:10:"translated";N;s:8:"original";s:7:"Look Up";s:15:"gettext_context";s:0:"";}i:140;O:8:"stdClass":6:{s:2:"id";s:5:"16905";s:6:"status";N;s:3:"ctx";s:32:"9c9a250abf56d290cbb03b05cda8055f";s:10:"translated";N;s:8:"original";s:84:"This screen is used for globally assigning menus to locations defined by your theme.";s:15:"gettext_context";s:0:"";}i:141;O:8:"stdClass":6:{s:2:"id";s:5:"16906";s:6:"status";N;s:3:"ctx";s:32:"3113ebe0bd15886d1b13e79d91119f46";s:10:"translated";N;s:8:"original";s:180:"To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s drop down.</strong> When you&#8217;re finished, <strong>click Save Changes</strong>";s:15:"gettext_context";s:0:"";}i:142;O:8:"stdClass":6:{s:2:"id";s:5:"16907";s:6:"status";N;s:3:"ctx";s:32:"02a6614ad27d526f06c00055e9d36b75";s:10:"translated";N;s:8:"original";s:114:"To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>";s:15:"gettext_context";s:0:"";}i:143;O:8:"stdClass":6:{s:2:"id";s:5:"16908";s:6:"status";N;s:3:"ctx";s:32:"8c31532238738ae3898b57622e2d0a6d";s:10:"translated";N;s:8:"original";s:183:"To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location";s:15:"gettext_context";s:0:"";}i:144;O:8:"stdClass":6:{s:2:"id";s:5:"16909";s:6:"status";N;s:3:"ctx";s:32:"fdc3798790f007dcd7196182c419b3d6";s:10:"translated";N;s:8:"original";s:14:"Theme Location";s:15:"gettext_context";s:0:"";}i:145;O:8:"stdClass":6:{s:2:"id";s:5:"16910";s:6:"status";N;s:3:"ctx";s:32:"3834c9e1ef73561b3479bfa284afc3b2";s:10:"translated";N;s:8:"original";s:13:"Assigned Menu";s:15:"gettext_context";s:0:"";}i:146;O:8:"stdClass":6:{s:2:"id";s:5:"16911";s:6:"status";N;s:3:"ctx";s:32:"957703b809a0d9cdc3ff1207a0e501ff";s:10:"translated";N;s:8:"original";s:13:"Select a Menu";s:15:"gettext_context";s:0:"";}i:147;O:8:"stdClass":6:{s:2:"id";s:5:"16912";s:6:"status";N;s:3:"ctx";s:32:"bbc6506b8a492d4536ea16e6f0a1c220";s:10:"translated";N;s:8:"original";s:4:"Edit";s:15:"gettext_context";s:4:"menu";}i:148;O:8:"stdClass":6:{s:2:"id";s:5:"16913";s:6:"status";N;s:3:"ctx";s:32:"073d182030daadb2f4251c3262b384e1";s:10:"translated";N;s:8:"original";s:12:"Use new menu";s:15:"gettext_context";s:4:"menu";}i:149;O:8:"stdClass":6:{s:2:"id";s:5:"16919";s:6:"status";N;s:3:"ctx";s:32:"9e7ade8c38be740b58f044bf1278fb0a";s:10:"translated";N;s:8:"original";s:324:"This screen lists all the existing users for your site. Each user has one of five defined roles as set by the site admin: Site Administrator, Editor, Author, Contributor, or Subscriber. Users with roles other than Administrator will see fewer options in the dashboard navigation when they are logged in, based on their role.";s:15:"gettext_context";s:0:"";}i:150;O:8:"stdClass":6:{s:2:"id";s:5:"16920";s:6:"status";N;s:3:"ctx";s:32:"18f746f02d07ad622b4a0b5c22b807d2";s:10:"translated";N;s:8:"original";s:120:"To add a new user for your site, click the Add New button at the top of the screen or Add New in the Users menu section.";s:15:"gettext_context";s:0:"";}i:151;O:8:"stdClass":6:{s:2:"id";s:5:"16921";s:6:"status";N;s:3:"ctx";s:32:"f5dbf0a6bfe21c08349893e933951fb5";s:10:"translated";N;s:8:"original";s:14:"Screen Display";s:15:"gettext_context";s:0:"";}i:152;O:8:"stdClass":6:{s:2:"id";s:5:"16922";s:6:"status";N;s:3:"ctx";s:32:"75b6f3ea46162ff1ee094bb0533bebb6";s:10:"translated";N;s:8:"original";s:65:"You can customize the display of this screen in a number of ways:";s:15:"gettext_context";s:0:"";}i:153;O:8:"stdClass":6:{s:2:"id";s:5:"16923";s:6:"status";N;s:3:"ctx";s:32:"48e4f7cb4f7122f5b317b5c99b0da496";s:10:"translated";N;s:8:"original";s:123:"You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.";s:15:"gettext_context";s:0:"";}i:154;O:8:"stdClass":6:{s:2:"id";s:5:"16924";s:6:"status";N;s:3:"ctx";s:32:"8653fbcfa867f1c95e2d3b856e2d8b47";s:10:"translated";N;s:8:"original";s:232:"You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.";s:15:"gettext_context";s:0:"";}i:155;O:8:"stdClass":6:{s:2:"id";s:5:"16925";s:6:"status";N;s:3:"ctx";s:32:"057d0d295c4e9c03bbba615601760927";s:10:"translated";N;s:8:"original";s:87:"You can view all posts made by a user by clicking on the number under the Posts column.";s:15:"gettext_context";s:0:"";}i:156;O:8:"stdClass":6:{s:2:"id";s:5:"16926";s:6:"status";N;s:3:"ctx";s:32:"6f27db27336dac372eb7553c49122b5b";s:10:"translated";N;s:8:"original";s:134:"Hovering over a row in the users list will display action links that allow you to manage users. You can perform the following actions:";s:15:"gettext_context";s:0:"";}i:157;O:8:"stdClass":6:{s:2:"id";s:5:"16927";s:6:"status";N;s:3:"ctx";s:32:"4f72db075b8db08eb81f0f579dcc8cf9";s:10:"translated";N;s:8:"original";s:120:"Edit takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.";s:15:"gettext_context";s:0:"";}i:158;O:8:"stdClass":6:{s:2:"id";s:5:"16928";s:6:"status";N;s:3:"ctx";s:32:"b0c1fa86fb67a24e3728970f430c6235";s:10:"translated";N;s:8:"original";s:209:"Delete brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using Bulk Actions.";s:15:"gettext_context";s:0:"";}i:159;O:8:"stdClass":6:{s:2:"id";s:5:"16929";s:6:"status";N;s:3:"ctx";s:32:"bbe160f1e8a89231b3e953098dcaa7f5";s:10:"translated";N;s:8:"original";s:7:"Actions";s:15:"gettext_context";s:0:"";}i:160;O:8:"stdClass":6:{s:2:"id";s:5:"16930";s:6:"status";N;s:3:"ctx";s:32:"90e62c69b88096b58347e5aa105664c7";s:10:"translated";N;s:8:"original";s:86:"<a href="https://codex.wordpress.org/Users_Screen">Documentation on Managing Users</a>";s:15:"gettext_context";s:0:"";}i: