i:450;O:8:"stdClass":6:{s:2:"id";s:5:"18724";s:6:"status";N;s:3:"ctx";s:32:"6dc4811cb0dd92196f1ed42b2062da7e";s:10:"translated";N;s:8:"original";s:150:"There is a new version of %1$s available. <a href="%2$s" %3$s>View version %4$s details</a>. <em>Automatic update is unavailable for this plugin.</em>";s:15:"gettext_context";s:0:"";}i:451;O:8:"stdClass":6:{s:2:"id";s:5:"19181";s:6:"status";N;s:3:"ctx";s:32:"0478b8c24763f98f604f2b9cf212fced";s:10:"translated";N;s:8:"original";s:31:"Horizontal position of bullets ";s:15:"gettext_context";s:0:"";}i:452;O:8:"stdClass":6:{s:2:"id";s:5:"19215";s:6:"status";N;s:3:"ctx";s:32:"0820628fb786a2845a8be09f503b4fa0";s:10:"translated";N;s:8:"original";s:124:"Put the thumbnails inside or outside of the slider container. Outside added thumbnails will decrease the size of the slider.";s:15:"gettext_context";s:0:"";}i:453;O:8:"stdClass":6:{s:2:"id";s:5:"19222";s:6:"status";N;s:3:"ctx";s:32:"573ddf82b3430ce4c9124f7f833ceb22";s:10:"translated";N;s:8:"original";s:33:"Horizontal position of thumbnails";s:15:"gettext_context";s:0:"";}i:454;O:8:"stdClass":6:{s:2:"id";s:5:"19328";s:6:"status";N;s:3:"ctx";s:32:"ee3c6978689df5a6c45f2c9c20af72f6";s:10:"translated";N;s:8:"original";s:112:"Put the tabs inside or outside of the slider container. Outside added tabs will decrease the size of the slider.";s:15:"gettext_context";s:0:"";}i:455;O:8:"stdClass":6:{s:2:"id";s:5:"19329";s:6:"status";N;s:3:"ctx";s:32:"b1bc47dc5d7aef363e4c95d77cedea9b";s:10:"translated";N;s:8:"original";s:28:"Horizontal position of tabs.";s:15:"gettext_context";s:0:"";}i:456;O:8:"stdClass":6:{s:2:"id";s:5:"19669";s:6:"status";N;s:3:"ctx";s:32:"4f7e28acd87a80481b3d3e571d2fdf59";s:10:"translated";N;s:8:"original";s:109:"https://global.mubashertrade.com/wp-admin/post.php?post=149&amp;action=edit&amp;lang=en&wpb_vc_js_status=true";s:15:"gettext_context";s:0:"";}i:457;O:8:"stdClass":6:{s:2:"id";s:5:"19670";s:6:"status";N;s:3:"ctx";s:32:"956531c04c718344f3ec7051dabed332";s:10:"translated";N;s:8:"original";s:47:"Sorry, you are not allowed to create new users.";s:15:"gettext_context";s:0:"";}i:458;O:8:"stdClass":6:{s:2:"id";s:5:"19671";s:6:"status";N;s:3:"ctx";s:32:"da040a5546ce2a7408f35f5673819254";s:10:"translated";N;s:8:"original";s:27:"Last edited on %1$s at %2$s";s:15:"gettext_context";s:0:"";}i:459;O:8:"stdClass":6:{s:2:"id";s:5:"19672";s:6:"status";N;s:3:"ctx";s:32:"9034cd10216a56ebc2fa0e7181b9720c";s:10:"translated";N;s:8:"original";s:38:"Drafts <span class="count">(%s)</span>";s:15:"gettext_context";s:0:"";}i:460;O:8:"stdClass":6:{s:2:"id";s:5:"19673";s:6:"status";N;s:3:"ctx";s:32:"bbdbb2efb2634466e433fce39f47fb20";s:10:"translated";N;s:8:"original";s:15:"Send Trackbacks";s:15:"gettext_context";s:0:"";}i:461;O:8:"stdClass":6:{s:2:"id";s:5:"19674";s:6:"status";N;s:3:"ctx";s:32:"09c81985949e99d25352c4eacbc7d9b2";s:10:"translated";N;s:8:"original";s:375:"The title field and the big Post Editing Area are fixed in place, but you can reposition all the other boxes using drag and drop. You can also minimize or expand them by clicking the title bar of each box. Use the Screen Options tab to unhide more boxes (Excerpt, Send Trackbacks, Custom Fields, Discussion, Slug, Author) or to choose a 1- or 2-column layout for this screen.";s:15:"gettext_context";s:0:"";}i:462;O:8:"stdClass":6:{s:2:"id";s:5:"19675";s:6:"status";N;s:3:"ctx";s:32:"be785ebfbe35e1089059bde74ea2968c";s:10:"translated";N;s:8:"original";s:24:"Customizing This Display";s:15:"gettext_context";s:0:"";}i:463;O:8:"stdClass":6:{s:2:"id";s:5:"19676";s:6:"status";N;s:3:"ctx";s:32:"caebf199686f82f701abc47dd032baad";s:10:"translated";N;s:8:"original";s:142:"<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.";s:15:"gettext_context";s:0:"";}i:464;O:8:"stdClass":6:{s:2:"id";s:5:"19677";s:6:"status";N;s:3:"ctx";s:32:"a0bfc377e504c07ae3b7b4ee7eb27344";s:10:"translated";N;s:8:"original";s:167:"<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.";s:15:"gettext_context";s:0:"";}i:465;O:8:"stdClass":6:{s:2:"id";s:5:"19678";s:6:"status";N;s:3:"ctx";s:32:"0742cd7bdba1eb1a84f296c900ab1bf1";s:10:"translated";N;s:8:"original";s:133:"Visual mode gives you an editor that is similar to a word processor. Click the Toolbar Toggle button to get a second row of controls.";s:15:"gettext_context";s:0:"";}i:466;O:8:"stdClass":6:{s:2:"id";s:5:"19679";s:6:"status";N;s:3:"ctx";s:32:"6822422cfd888b5560ab16ce486fcf0f";s:10:"translated";N;s:8:"original";s:377:"The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.";s:15:"gettext_context";s:0:"";}i:467;O:8:"stdClass":6:{s:2:"id";s:5:"19680";s:6:"status";N;s:3:"ctx";s:32:"c495912a27038b213ad535fd59f27db5";s:10:"translated";N;s:8:"original";s:191:"You can insert media files by clicking the icons above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.";s:15:"gettext_context";s:0:"";}i:468;O:8:"stdClass":6:{s:2:"id";s:5:"19681";s:6:"status";N;s:3:"ctx";s:32:"dda7292d6cc6432d85981a7dcd8632bc";s:10:"translated";N;s:8:"original";s:222:"You can enable distraction-free writing mode using the icon to the right. This feature is not available for old browsers or devices with small screens, and requires that the full-height editor be enabled in Screen Options.";s:15:"gettext_context";s:0:"";}i:469;O:8:"stdClass":6:{s:2:"id";s:5:"19682";s:6:"status";N;s:3:"ctx";s:32:"e901e1db104415c51215b85c60c4835b";s:10:"translated";N;s:8:"original";s:119:"Keyboard users: When you&#8217;re working in the visual editor, you can use <kbd>Alt + F10</kbd> to access the toolbar.";s:15:"gettext_context";s:0:"";}i:470;O:8:"stdClass":6:{s:2:"id";s:5:"19683";s:6:"status";N;s:3:"ctx";s:32:"b8b9703f0ca48b495552f41029e80cae";s:10:"translated";N;s:8:"original";s:21:"Title and Post Editor";s:15:"gettext_context";s:0:"";}i:471;O:8:"stdClass":6:{s:2:"id";s:5:"19684";s:6:"status";N;s:3:"ctx";s:32:"d0528ae0c11e8490f10c23327b15cafe";s:10:"translated";N;s:8:"original";s:75:"You can also create posts with the <a href="%s">Press This bookmarklet</a>.";s:15:"gettext_context";s:0:"";}i:472;O:8:"stdClass":6:{s:2:"id";s:5:"19685";s:6:"status";N;s:3:"ctx";s:32:"99d628390ea881f30d379221d4b5b3c9";s:10:"translated";N;s:8:"original";s:105:"<a href="https://codex.wordpress.org/Posts_Add_New_Screen">Documentation on Writing and Editing Posts</a>";s:15:"gettext_context";s:0:"";}i:473;O:8:"stdClass":6:{s:2:"id";s:5:"19686";s:6:"status";N;s:3:"ctx";s:32:"bdd00e4dc7b125be80afef3e9209657a";s:10:"translated";N;s:8:"original";s:96:"Several boxes on this screen contain settings for how your content will be published, including:";s:15:"gettext_context";s:0:"";}i:474;O:8:"stdClass":6:{s:2:"id";s:5:"19687";s:6:"status";N;s:3:"ctx";s:32:"ffea9d2f9ee57d2e3ab4a669c39607c5";s:10:"translated";N;s:8:"original";s:637:"<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.";s:15:"gettext_context";s:0:"";}i:475;O:8:"stdClass":6:{s:2:"id";s:5:"19688";s:6:"status";N;s:3:"ctx";s:32:"a802c479a057bc8c8d3892f320b37b76";s:10:"translated";N;s:8:"original";s:463:"<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Please refer to the Codex for <a href="https://codex.wordpress.org/Post_Formats#Supported_Formats">descriptions of each post format</a>. Your theme could enable all or some of 10 possible formats.";s:15:"gettext_context";s:0:"";}i:476;O:8:"stdClass":6:{s:2:"id";s:5:"19689";s:6:"status";N;s:3:"ctx";s:32:"3006d7934608817a28a556e753065609";s:10:"translated";N;s:8:"original";s:227:"<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.";s:15:"gettext_context";s:0:"";}i:477;O:8:"stdClass":6:{s:2:"id";s:5:"19690";s:6:"status";N;s:3:"ctx";s:32:"ed908076c5465e005358015d38aabe07";s:10:"translated";N;s:8:"original";s:16:"Publish Settings";s:15:"gettext_context";s:0:"";}i:478;O:8:"stdClass":6:{s:2:"id";s:5:"19691";s:6:"status";N;s:3:"ctx";s:32:"0671b4a2f6125c4f545933974afb647d";s:10:"translated";N;s:8:"original";s:296:"<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.";s:15:"gettext_context";s:0:"";}i:479;O:8:"stdClass":6:{s:2:"id";s:5:"19692";s:6:"status";N;s:3:"ctx";s:32:"feb178d959aae886b2dde85248492051";s:10:"translated";N;s:8:"original";s:158:"<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.";s:15:"gettext_context";s:0:"";}i:480;O:8:"stdClass":6:{s:2:"id";s:5:"19693";s:6:"status";N;s:3:"ctx";s:32:"e0beb45b13f598d5797fddee61690000";s:10:"translated";N;s:8:"original";s:19:"Discussion Settings";s:15:"gettext_context";s:0:"";}i:481;O:8:"stdClass":6:{s:2:"id";s:5:"19694";s:6:"status";N;s:3:"ctx";s:32:"8c15114e713ddacc46ecddcd0202cb99";s:10:"translated";N;s:8:"original";s:33:"Stick this post to the front page";s:15:"gettext_context";s:0:"";}i:482;O:8:"stdClass":6:{s:2:"id";s:5:"19695";s:6:"status";N;s:3:"ctx";s:32:"cb18267163ca9501e1f3ddc65a2ec252";s:10:"translated";N;s:8:"original";s:12:"Post Formats";s:15:"gettext_context";s:0:"";}i:483;O:8:"stdClass":6:{s:2:"id";s:5:"19696";s:6:"status";N;s:3:"ctx";s:32:"e706af56d8281f6f328ef22419941fa8";s:10:"translated";N;s:8:"original";s:143:"Excerpts are optional hand-crafted summaries of your content that can be used in your theme. <a href="%s">Learn more about manual excerpts</a>.";s:15:"gettext_context";s:0:"";}i:484;O:8:"stdClass":6:{s:2:"id";s:5:"19697";s:6:"status";N;s:3:"ctx";s:32:"ce52f05e2725390e7212bbfbc87b5503";s:10:"translated";N;s:8:"original";s:35:"https://codex.wordpress.org/Excerpt";s:15:"gettext_context";s:0:"";}i:485;O:8:"stdClass":6:{s:2:"id";s:5:"19698";s:6:"status";N;s:3:"ctx";s:32:"377404b429dc1cd0fcd2a59c058bd56f";s:10:"translated";N;s:8:"original";s:19:"Send trackbacks to:";s:15:"gettext_context";s:0:"";}i:486;O:8:"stdClass":6:{s:2:"id";s:5:"19699";s:6:"status";N;s:3:"ctx";s:32:"f914d7649fca88028dc5b54b62ad1c8f";s:10:"translated";N;s:8:"original";s:34:"Separate multiple URLs with spaces";s:15:"gettext_context";s:0:"";}i:487;O:8:"stdClass":6:{s:2:"id";s:5:"19700";s:6:"status";N;s:3:"ctx";s:32:"3bbe6f49100018f3dd9bef957319ccfc";s:10:"translated";N;s:8:"original";s:220:"Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. If you link other WordPress sites, they&#8217;ll be notified automatically using <a href="%s">pingbacks</a>, no other action necessary.";s:15:"gettext_context";s:0:"";}i:488;O:8:"stdClass":6:{s:2:"id";s:5:"19701";s:6:"status";N;s:3:"ctx";s:32:"2b47bc9ffdc6839e9b2af24c211fa510";s:10:"translated";N;s:8:"original";s:82:"<a href="https://codex.wordpress.org/Revision_Management">Revisions Management</a>";s:15:"gettext_context";s:0:"";}i:489;O:8:"stdClass":6:{s:2:"id";s:5:"19702";s:6:"status";N;s:3:"ctx";s:32:"cf6b1d73968b6d28b1facc92bbe3a9eb";s:10:"translated";N;s:8:"original";s:41:"<strong>ERROR</strong>: Invalid username.";s:15:"gettext_context";s:0:"";}i:490;O:8:"stdClass":6:{s:2:"id";s:5:"19703";s:6:"status";N;s:3:"ctx";s:32:"b695417df137011acaa43a21dc5f4a65";s:10:"translated";N;s:8:"original";s:109:"https://global.mubashertrade.com/wp-admin/post.php?post=860&amp;action=edit&amp;lang=en&wpb_vc_js_status=true";s:15:"gettext_context";s:0:"";}i:491;O:8:"stdClass":6:{s:2:"id";s:5:"19704";s:6:"status";N;s:3:"ctx";s:32:"f52dc10a511ead99bfbe42d76dd72906";s:10:"translated";N;s:8:"original";s:14:"#%d (no title)";s:15:"gettext_context";s:0:"";}i:492;O:8:"stdClass":6:{s:2:"id";s:5:"19733";s:6:"status";N;s:3:"ctx";s:32:"a3b2978099b43be30a0883b94a716a6e";s:10:"translated";N;s:8:"original";s:16:"Writing Settings";s:15:"gettext_context";s:0:"";}i:493;O:8:"stdClass":6:{s:2:"id";s:5:"19734";s:6:"status";N;s:3:"ctx";s:32:"f86ab1682d11f3bf7e8923776b1c375c";s:10:"translated";N;s:8:"original";s:282:"You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.";s:15:"gettext_context";s:0:"";}i:494;O:8:"stdClass":6:{s:2:"id";s:5:"19735";s:6:"status";N;s:3:"ctx";s:32:"7b0c60491aec7654518f94c1af7bec98";s:10:"translated";N;s:8:"original";s:14:"Post Via Email";s:15:"gettext_context";s:0:"";}i:495;O:8:"stdClass":6:{s:2:"id";s:5:"19736";s:6:"status";N;s:3:"ct